import React from "react";
import Pokemon from "./pokemon";

class Pokedex extends React.Component {
  constructor() {
    super();
    this.chamaOProximo = this.chamaOProximo.bind(this);
  };

  chamaOProximo(event) {
    <event className="target"></event>
  }

  render() {
    const pokemons = this.props.poke;
    return (
        <div>
          <button onClick={chamaOProximo}>Próximo</button>
          {pokemons.map((pokemon) => <Pokemon key={pokemon.id} poke={pokemon} />)}
        </div>
    );
  }
};

export default Pokedex;
